import React from "react";
import styled from "styled-components";


function contactButton() {
    return (
        <div>
            <button>
                Contact Me
            </button>
        </div>
    )
}

function aboutButton() {
    return (
        <div>
            <button>
                About Me
            </button>
        </div>
    )
}

export default contactButton;
